const vip = localStorage.getItem("vip");

function SelfStudent() {
    return (
        <div className="self-content">
            {!vip
                ? <div>管理的自习室</div>
                : <div>加入的自习室</div>
            }
        </div>
    )
}

export default SelfStudent;
